  false,\n\t\"url\": null,\n\t\"notes\": \"The National School Lunch Program (NSLP),
  School Breakfast Program (SBP) and Summer Food Service Program (SFSP) provide nutritious
  meals to children in New York City Public Schools. All children attending schools
  that offer these programs can receive breakfast and lunch. Breakfast is free for
  all students. Some children will qualify for free or reduced price lunch, and others
  pay the full cost of meals, depending on family and income. This income chart sets
  forth the different meal costs.This chart is only a guide. Individuals should see
  school office personnel for assistance. rnNOTE: Chart effective July 1, 2012 to
  June 30, 2013. Subject to annual income updates.\",\n\t\"license_title\": \"License
